const oatsGrid = document.getElementById('oatsGrid');

// Function to display oats recipes
function displayOatsRecipes(recipes) {
    oatsGrid.innerHTML = '';
    recipes.forEach(recipe => {
        const card = document.createElement('div');
        card.className = 'oats-card';
        card.innerHTML = `
            <img src="${recipe.image}" alt="${recipe.title}">
            <h2>${recipe.title}</h2>
            <p>${recipe.description}</p>
        `;
        oatsGrid.appendChild(card);
    });
}

// Initial display of all oats recipes
displayOatsRecipes(oatsRecipes);
